function Home(props) {
    return (
        <div className="bg-white">
            <section>
                <header>
                    <img 
                        src="/images/bg/LEARNING_ENGLISH_BETTER.png" 
                        alt='intro-bg'
                        className="main-intro"
                    />
                </header>
            </section>
        </div>
    );
}

export default Home;
